import React from "react";
import Card from "./Card";

function Cards() {
  return (

    <div className= "container pt-4 d-flex justify-content-center h-100 align-items-center">
      <div className="row">
        <div className="col-lg-4" >
          <Card />
        </div>
        <div className="col-lg-4">
          <Card />
        </div>
        <div className="col-lg-4">
          <Card />
        </div>
      </div>
    </div>
  );
}

export default Cards;
